import React from 'react';
import '../../styles/App.css';

class Production extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <div className="projectBody">
                <h2>Electronic Music Production</h2>
                <p>
                    I started writing, recording, and producing my first mini-EP in the summer of 2021!
                    Since then, I have also released a few other singles on my artist profile.
                    Follow my music on all platforms by clicking on the links below!
                </p>

                <br/>

                <iframe className="frame" src="https://distrokid.com/hyperfollow/lucaspao/where-did-you-go" frameBorder="0"></iframe>
            </div>
        );
    }
}

export default Production;
